content: >-
  <p class="p"><span data-number="33" data-sid="ACT 10:33"
  class="v">33</span>Immediately therefore I sent to thee; and thou hast well
  done that thou art come. Now therefore are we all here present before God, to
  hear all things that are commanded thee of God.</p>
